import React, { Component, useReducer } from "react";

// const Login = () => {
//   return <div>Login</div>;
// };

class Login extends Component {
  render() {
    return (
      <div>
        <h1>Login</h1>
        <input type="text" placeholder="email" />
      </div>
    );
  }
}

export default Login;
